      "description": "Фольгированный шар для украшения праздника, приспособлен под гелий. Фольгированные воздушные шары изготавливаются из тонкой миларовой пленки, позволяющей шару не сдуваться в течение нескольких дней. Фольгированные воздушные шары надувают через клапан. Поэтому плотно надутый шар завязывать не требуется - обратный клапан хорошо удерживает гелий внутри шара. К шару привязывают ленту только для того, чтобы шар не улетел. Сдувшийся фольгированный шар можно поддуть гелием или воздухом и он всегда будет иметь товарный вид.",
